create table issued_id (
	id INT,
	first_name VARCHAR(50),
	middle_init VARCHAR(50),
	last_name VARCHAR(50),
	phone_number_home VARCHAR(50),
	phone_number_work VARCHAR(50),
	birth_date DATE,
	id_creation_date DATE,
	id_expiration_date DATE,
	gender VARCHAR(50),
	grant_status VARCHAR(50),
	social_security_number VARCHAR(50),
	citizenship_status VARCHAR(50),
	email VARCHAR(50),
	status VARCHAR(50),
	department_id VARCHAR(50)
);
